Uploader's comments - Beware of this 'new way' to pay off mortgages.  Watching the video on their site explains that it's a new loan/equity line that you use as your operating account (checking account) and you use their program to figure out how much/when to pay.  The new loan is a variable rate... It seems pretty stupid to me to get a variable rate when mortgage rates are at 50 year lows... where do you think the rates are going to go from here?  The honest truth is that you cannot borrow your way out of debt.  The only way to pay off debt faster is to make principle payments and/or lower the interest rate.  For a real, no BS plan on getting out of debt and paying off your mortgage visit &lt;a href=&quot;
